V8:
Ceyranbatan qəsəbəsində yerləşən «Eko Park» yaşayış kompleksində 2 otaqlı 73 kv.m. təmirsiz qazi, suyu, işığı, kupcasi olan mənzil satılır. Kompleksdə aşağıdakılar yerləşir
yeraltı parkinq;
uşaq meydançasi;
idman meydançasi;
tennis kortu;
futbol meydançasi;
Mənzil şirkətdən 51000 manata alınıb (73*700=51000) təcili satılır deye 42000 manata satılır. Barter mumkundur ili teze probeqi az avtomobille barter qiymeti 45000
